import React, { Component } from 'react';

class ColoBox extends Component {
    render () {
        return (
            <div style={{ backfaceVisibility: this.props.background }} className="ColorBox">
                <span>{this.props.name}</span>
                <span>Home</span>
            </div>
        );
    }
}

export default ColoBox;
